import { Login } from "./pages/Login";
import { BrowserRouter as Router, Route, Routes,Link } from 'react-router-dom';

function App() {
  return (
    <div>
      <Router>
      <div>
        <Routes>
          <Route path="/login" exact component={Login} />
        </Routes>
      </div>
    </Router>
    </div>

  );
}

export default App;
